function Game_State_Display(){
    ctx.fillStyle="#121213";
    ctx.fillRect(0,0,714,570);
    ctx.fillStyle="#3a3a3c";
    for(x=0;x<5;x++){
        for(y=0;y<6;y++){
            ctx.fillRect(x*80+(x+1)*12+2,y*80+(y+1)*12+1,80,80);
        }       
    }
    ctx.fillRect(474,13,227,80);
    ctx.fillStyle="#121213";
    ctx.fillRect(477,16,221,74);
    for(x=0;x<5;x++){
        for(y=0;y<6;y++){
            ctx.fillRect(x*80+(x+1)*12+5,y*80+(y+1)*12+4,74,74);
        }       
    }
    f.load().then(function(font) { document.fonts.add(font);
        ctx.font = '35px PressStart2P-Regular';
        ctx.textAlign = "center";
        if(completed[0]==false){
            ctx.fillStyle = "#d7dadc";
            ctx.fillText("Daily Word!",587,66);
        }else{
            ctx.fillStyle = "#d7dadc";
            ctx.fillText("Unlimited!",587,66);
        }
        var total=""
        for(y=0;y<index;y++){
            total=total+words[y]
        }
        ctx.font = '25px PressStart2P-Regular';
        for(y=0;y<7;y++){
            for(x=0;x<4;x++){
                if(!(x==0 && y==6) && !(x==3 && y==6)){
                    if(x==1 && y==6){
                        letter="Y"
                    }else if(x==2 && y==6){
                        letter="Z"
                    }else{
                        letter=String.fromCharCode(y*4+x+97).toUpperCase()
                    }
                    if(total.indexOf(letter)!=-1){
                        if(letters[letters.indexOf(letter.toLowerCase())+1]=="1"){
                            ctx.fillStyle="#538d4e";
                        }else if(word.indexOf(letter)!=-1){
                            ctx.fillStyle="#b59f3b";
                        }else{
                            ctx.fillStyle="#818384";
                        }
                    }else{
                        ctx.fillStyle="#3a3a3c";
                    }
                    ctx.roundRect(475+x*50+x*9, 108+y*55+y*9, 50, 56, 8).fill();
                    ctx.fillStyle = "#d7dadc";
                    ctx.fillText(letter, 500+x*50+x*9, 145+y*55+y*9);
                }
            } 
        } 
        if(Date.now()-not_word<=1400){
            var xchange=Math.min((Date.now()-not_word)*(190/200),190)
            var ychange=Math.min((Date.now()-not_word)*(60/200),60)
            ctx.fillStyle="#808080";
            ctx.fillRect(80+161-xchange/2,30+253-ychange/2,xchange,ychange);
            ctx.fillStyle="#121213";
            var xchange=Math.min((Date.now()-not_word)*(180/200),180)
            var ychange=Math.min((Date.now()-not_word)*(50/200),50)
            ctx.fillRect(75+166-xchange/2,25+258-ychange/2,xchange,ychange);
            if(Date.now()-not_word>=200){
                var size=Math.min(((Date.now()-not_word)-200)*(20/200),20)
                ctx.fillStyle = "#d7dadc";
                ctx.font = size.toString()+'px PressStart2P-Regular';
                ctx.fillText("Not a valid word",240, 288);
            }
        }     
    });
    for(x=0;x<5;x++){
        for(y=0;y<index;y++){
            if(word[x]==words[y][x]){
                letters=letters.replaceAt(letters.indexOf(word[x].toLowerCase())+1,"1")
            }
            if(y==index-1 && Date.now()-guess_time<=(x+1)*200-100 && Date.now()-guess_time>=x*200){
                ctx.fillStyle="#808080";
                var change=Math.round((Date.now()-guess_time-x*200)*(8/100))
                ctx.fillRect(x*80+(x+1)*12+2-change,y*80+(y+1)*12+1-change,80+change*2,80+change*2);
                ctx.fillStyle="#121213";
                ctx.fillRect(x*80+(x+1)*12+5-change,y*80+(y+1)*12+4-change,74+change*2,74+change*2);
            }else if(y!=index-1 || y==index-1 && Date.now()-guess_time>=(x+1)*200-100){
                var change=0
                if(y==index-1 && Date.now()-guess_time<(x+1)*200 && Date.now()-guess_time>x*200+100){
                    var change=8-(Math.round((Date.now()-guess_time-x*200-100)*(8/100)))
                }
                if(word[x]==words[y][x]){
                    letters=letters.replaceAt(letters.indexOf(word[x].toLowerCase())+1,"1")
                    ctx.fillStyle="#538d4e";
                    ctx.fillRect(x*80+(x+1)*12+2-change,y*80+(y+1)*12+1-change,80+change*2,80+change*2);
                }else if(word.indexOf(words[y][x])!=-1){
                    ctx.fillStyle="#b59f3b";
                    ctx.fillRect(x*80+(x+1)*12+2-change,y*80+(y+1)*12+1-change,80+change*2,80+change*2);
                }else{
                    ctx.fillStyle="#3a3a3c";
                    ctx.fillRect(x*80+(x+1)*12+2-change,y*80+(y+1)*12+1-change,80+change*2,80+change*2);
                }
            }
        }       
    }
    f.load().then(function(font) { document.fonts.add(font)
        ctx.font = '52px PressStart2P-Regular';
        ctx.fillStyle = "#d7dadc";
        ctx.textAlign = "center";
        for(a=0;a<words.length;a++){
            for(b=0;b<words[a].length;b++){
                ctx.fillText(words[a][b], b*80+(b+1)*12+41, a*80+(a+1)*12+59);
            }
        }
        if(state[0]!="playing" && Date.now()-state[1]>1000 && view==false){
            var xchange=Math.min(((Date.now()-state[1])-1000)*(244/300),244)
            var ychange=Math.min(((Date.now()-state[1])-1000)*(152/300),152)
            var xchange1=Math.min(((Date.now()-state[1])-1000)*(224/300),224)
            var ychange1=Math.min(((Date.now()-state[1])-1000)*(132/300),132)
            ctx.fillStyle="#808080";
            ctx.fillRect(232-xchange/2+5,412-ychange/2-130,xchange,ychange);
            ctx.fillStyle="#121213";
            ctx.fillRect(252-xchange1/2-14,432-ychange1/2-150,xchange1,ychange1); 
            var size=Math.min(((Date.now()-state[1])-1350)*(38/200),38)
            ctx.font = size.toString()+'px PressStart2P-Regular';
            ctx.fillStyle = "#d7dadc";
            if(state[0]=="solved"){
                if(Date.now()-state[1]>=1350){
                    ctx.fillText("Well Done!", 238, 270); 
                    if(Date.now()-state[1]>=1650){
                        var size=Math.min(((Date.now()-state[1])-1650)*(18/200),18)
                        ctx.font = size.toString()+'px PressStart2P-Regular';
                        if(index==1){
                            ctx.fillText("You solved it in 1 try", 238, 316);
                        }else{
                            ctx.fillText("You solved it in "+index+" tries", 238, 316);
                        }
                    }
                }
            }else if(state[0]=="finished"){
                if(Date.now()-state[1]>=1350){
                    ctx.fillText("So Close!", 238, 270);
                    if(Date.now()-state[1]>=1650){
                        var size=Math.min(((Date.now()-state[1])-1650)*(18/200),18)
                        ctx.font = size.toString()+'px PressStart2P-Regular'; 
                        ctx.fillText("The word was "+word.toLowerCase(), 238, 316);
                    }
                }
            }
        }
    }); 
}
CanvasRenderingContext2D.prototype.roundRect = function (x, y, w, h, r) {
  if (w < 2 * r) r = w / 2;
  if (h < 2 * r) r = h / 2;
  this.beginPath();
  this.moveTo(x+r, y);
  this.arcTo(x+w, y,   x+w, y+h, r);
  this.arcTo(x+w, y+h, x,   y+h, r);
  this.arcTo(x,   y+h, x,   y,   r);
  this.arcTo(x,   y,   x+w, y,   r);
  this.closePath();
  return this;
}
String.prototype.replaceAt = function(index, replacement) {
    return this.substr(0, index) + replacement + this.substr(index + replacement.length);
}
document.body.addEventListener("keydown", function (e) {
    if(e.keyCode==13){
        console.log(words[index],words,index,"W")
        if(state[0]!="playing"){
            initialize()
        }else if(word_bank2.indexOf(words[index].toLowerCase())!=-1 && word_bank2.indexOf(words[index].toLowerCase())%5==0 && words[index]!="" && words[index].length==5){
            index=index+1
            guess_time=Date.now()
        }else if(state[0]=="playing" && words[index].length==5){
            not_word=Date.now()
        }

        if(word==words[index-1]){
            state=["solved",Date.now()]
            completed=[true,Date.now()/(1000*60*60*24)]
        }else if(index==6){
            state=["finished",Date.now()]
            completed=[true,Date.now()/(1000*60*60*24)]
        }
    }else if(e.keyCode==8 && words[index].length!=0){
        words[index]=words[index].substring(0, words[index].length - 1);
    }else if(e.keyCode==32 && state[0]!="playing"){
        view=true
    }else{
        abc="abcdefghijklmnopqrstuvwxyz1234567890"
        if(words[index].length<5 && abc.indexOf(String.fromCharCode(e.keyCode).toLowerCase())!=-1){
            words[index]=words[index]+String.fromCharCode(e.keyCode).toUpperCase()
        }
    }
    Game_State_Display();
});
function sleep(ms) {
    return new Promise(resolve => setTimeout(resolve, ms));
}
function initialize(){
    index=0
    words=["","","","","",""]
    word=word_bank
    if(completed[0]==false){
        i=(Math.floor(Date.now()/(1000*60*60*24))-19034)%2315*5
    }else{
        i=Math.floor(Math.random() * 2315)*5;
    }
    word=word.slice(i,i+5)
    state=["playing",0]
    start=Date.now();
    guess_time=0
    view=false
    letters="a0b0c0d0e0f0g0h0i0j0k0l0m0n0o0p0q0r0s0t0u0v0w0x0y0z0"
    console.log(word)
}
if(typeof(Storage) !== "undefined") {
    var completed=JSON.parse(window.localStorage.getItem('Wordle_completed'));
    if (completed==null){
        var completed=[false,Date.now()/(1000*60*60*24)]
    }
}
if(Math.floor(Date.now()/(1000*60*60*24))!=Math.floor(completed[1])){
    completed[0]=false
}
var canvas = document.getElementById("Screen");
var ctx = canvas.getContext('2d');
var f = new FontFace('PressStart2P-Regular', 'url(Helvetica-Neue.otf)');
var word_bank="";
var word_bank2=""
var not_word=0
initialize();
async function gameLoop(){
    if(Date.now()-guess_time<=1000 || Date.now()-state[1]<=1850 || Date.now()-not_word<=1400){
        if(Date.now()-start>10){
            start=Date.now();
            Game_State_Display();
        }else{
            await sleep(Math.max(10-(Date.now()-start),0));
        }
    }else{
        if(Date.now()-start>100){
            start=Date.now();
            Game_State_Display();
            window.localStorage.setItem('Wordle_completed',JSON.stringify(completed));
        }else{
            await sleep(Math.max(100-(Date.now()-start),0));
        }
    }
    window.requestAnimationFrame(gameLoop);
}
window.requestAnimationFrame(gameLoop);